script: |
  super -f text -I q10497.spq | sort > q10497.out

inputs:
  - name: q10497.spq
    data: |
      SELECT + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL IS NULL OR ( + 64 ) * + 96 + + + col0 * 73 + + - 91 + - col0 * col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q10497.out
    data: |
      51
      85
      91
